//自定义函数开始

void searchPlace(int new_x,int new_y,int thisFlag,char thisBoard[BOARD_SIZE][BOARD_SIZE])
{
    int anotherFlag=3-thisFlag;
    // 挑
    for (int i = 0; i < 4; i++)
    {
        int x1 = new_x + intervention_dir[i][0];
        int y1 = new_y + intervention_dir[i][1];
        int x2 = new_x - intervention_dir[i][0];
        int y2 = new_y - intervention_dir[i][1];
        if (isInBound(x1, y1) && isInBound(x2, y2) && thisBoard[x1][y1] == anotherFlag && thisBoard[x2][y2] == anotherFlag)
        {
            thisBoard[x1][y1] = thisFlag;
            thisBoard[x2][y2] = thisFlag;
        }
    }

    // 夹
    for (int i = 0; i < 8; i++)
    {
        int x1 = new_x + custodian_dir[i][0];
        int y1 = new_y + custodian_dir[i][1];
        int x2 = new_x + custodian_dir[i][0] * 2;
        int y2 = new_y + custodian_dir[i][1] * 2;
        if (isInBound(x1, y1) && isInBound(x2, y2) && thisBoard[x2][y2] == thisFlag && thisBoard[x1][y1] == anotherFlag)
        {
            thisBoard[x1][y1] = thisFlag;
        }
    }
}

BOOL isWhoseInThisBoard(int x, int y,char thisBoard[BOARD_SIZE][BOARD_SIZE],int whoseFlag)
{
    return thisBoard[x][y]==whoseFlag;
}

