int AlphaBeta(int nPlay,int nAlpha,int nBeta,char thisBoard[BOARD_SIZE][BOARD_SIZE],int thisFlag)
{
    //printf("depth %d\n",nPlay);
    char currentBoard[BOARD_SIZE][BOARD_SIZE];
    int score;
    int i;
    int j;
    int k;
    int x;
    int y;
    int ii;
    int jj;
    int searchSeq[8];
     if(nPlay==2||nPlay==4)//分配搜索顺序，自身
    {
        if (meFlag==1)
        {
            for (i=0; i<8; i++)
            {
                searchSeq[i]=searchSeq1B[i];
            }
        }
        if (meFlag==2)
        {
            for (i=0; i<8; i++)
            {
                searchSeq[i]=searchSeq1W[i];
            }
        }
    }
    if(nPlay==1||nPlay==3)//分配搜索顺序，对方
    {
        if (otherFlag==1)
        {
            for (i=0; i<8; i++)
            {
                searchSeq[i]=searchSeq1B[i];
            }
        }
        if (otherFlag==2)
        {
            for (i=0; i<8; i++)
            {
                searchSeq[i]=searchSeq1W[i];
            }
        }
    }
    if(nPlay==0)
        return searchValue(thisBoard);  //叶子节点返回估值
    for (i=0; i<BOARD_SIZE; i++)//备份棋盘
    {
        for (j=0; j<BOARD_SIZE; j++)
        {
            currentBoard[i][j]=thisBoard[i][j];
        }
    }
    for (k=0; k<=7; k++)
    {
        for (i=0; i<BOARD_SIZE; i++)
        {
            for (j=0; j<BOARD_SIZE; j++)
            {
                if (isWhoseInThisBoard(i,j,currentBoard,thisFlag)==1)
                {
                    x=i+DIR[searchSeq[k]][0];
                    y=j+DIR[searchSeq[k]][1];
                    if (isInBound(x,y)&&currentBoard[x][y]==0)//LegalMove落子
                    {
                        currentBoard[x][y]=thisFlag;
                        currentBoard[i][j]=EMPTY;
                        searchPlace(x,y,thisFlag,currentBoard);//生成新节点
                        score=-AlphaBeta(nPlay-1,-nBeta,-nAlpha,currentBoard,3-thisFlag);//递归搜索子节点
                        for (ii=0; ii<BOARD_SIZE; ii++) //恢复原节点
                        {
                            for (jj=0; jj<BOARD_SIZE; jj++)
                            {
                                currentBoard[ii][jj]=thisBoard[ii][jj];
                            }
                        }
                        if (score > nAlpha)//比当前最小值大
                        {
                            nAlpha=score;//擦写当前最小值(nAlpha)为score
                            if(nPlay==4)//擦写全局command
                            {
                                command.x=i;
                                command.y=j;
                                command.option=searchSeq[k];
                            }
                        }
                        if (score >= nBeta)//比当前最小值大
                        {
                            return nBeta;//Beta剪枝，抛弃后续节点
                        }
                    }
                }
            }
        }
    }
    return nAlpha;//返回最小值
}
